import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search input to be visible and enter 'team'
    await page.waitForSelector('#eventSearchInput');
    await page.fill('#eventSearchInput', 'team');

    // Take screenshot after entering the search term
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_input.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_input.png'));

    // Wait for the search button to be visible and click it
    await page.waitForSelector('.search-btn');
    await page.click('.search-btn');

    // Take screenshot after clicking the search button
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_button_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_button_clicked.png'));

    // Wait for the results to load (you may need to adjust the selector based on the actual results)
    await page.waitForSelector('.event-results'); // Assuming '.event-results' is the selector for the results

    // Extract meaningful data (e.g., event titles)
    const eventTitles = await page.$$eval('.event-title', titles => titles.map(title => title.textContent));

    return {
      success: true,
      action: "Searched for team-related events",
      extractedData: { eventTitles },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

