import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search input field to be available and enter 'team'
    await page.waitForSelector('#eventSearchInput');
    await page.fill('#eventSearchInput', 'team');

    // Take a screenshot after entering the search term
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_input_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_input_filled.png'));

    // Wait for the search button and click it
    await page.waitForSelector('.search-btn');
    await page.click('.search-btn');

    // Wait for the search results to load (you may need to adjust this based on the actual behavior of the page)
    await page.waitForSelector('.event-results'); // Assuming there is a container for results

    // Take a screenshot of the results
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_results.png'));

    // Extract some meaningful data, e.g., the number of events found
    const eventsFound = await page.evaluate(() => {
      return document.querySelectorAll('.event-item').length; // Assuming each event has the class 'event-item'
    });

    return {
      success: true,
      action: "Searched for team-related events and captured search results.",
      extractedData: { eventsFound },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
